var rounded=function(number){return+number.toFixed(2);}
var times4feedbackObj=data.kick_times4feedback;function sortObj(obj){var effect=obj.effects.flat();if(effect.length>0||obj.texts!==' '){return obj;}}
Object.filter=(obj,predicate)=>Object.keys(obj).filter(key=>predicate(obj[key])).reduce((res,key)=>Object.assign(res,{[key]:obj[key]}),{});var filtered=Object.filter(times4feedbackObj,sortObj);function render(key,el){b=document.createElement('div');b.classList.add(key);b.innerHTML=el;hintContainer.appendChild(b);}
function renderEffects(){Object.keys(filtered).forEach(function(key){var effect=filtered[key].effects.flat();effect.forEach(element=>{render(key,element);});var hand=filtered[key].texts;switch(hand){case'R':render(key,R)
break;case'L':render(key,L)
break;}});}
function setTime(curTime){Object.keys(filtered).forEach(function(key){var startTime=rounded(filtered[key].time);var endTime=rounded((filtered[key].time)+(filtered[key].duration_second));if(curTime>startTime){var el=document.getElementsByClassName(key);Array.from(el).forEach(element=>{element.style.color='green';if(curTime>endTime){element.style.display='none';}});}});}
function refreshRender(){Object.keys(filtered).forEach(function(key){var el=document.getElementsByClassName(key);Array.from(el).forEach(element=>{element.style.color='black';element.style.display='block';});});}
